  false,\n\t\"url\": null,\n\t\"notes\": \"Belt transects along 2 consecutively-placed,
  25m transect lines were surveyed as part of Rapid Ecological Assessments conducted
  at 3 sites at Gardner Pinnacles in the Northwestern Hawaiian Islands in September,
  2004 from the NOAA vessel Hi'ialakai (HII04-01). Raw survey data included species
  presence and relative abundance, colony counts and size classes, and visual estimation
  of percent cover. Either 0.5m or 1m on each side of the transect lines were included
  in the belt (for a total of 50m2 or 100m2 per site), depending on colony density.\",\n\t\"license_title\":
